Create Index by population ranges<p>New to MongoDB, and I am trying to categorise populations of cities and counties based on their population. A sample of the data would be as follows:</p>

<pre><code>{ "_id" : "D", "name" : "Dar-e-salaam", "pop" : 212253 }
{ "_id" : "WF", "name" : "Westfalia", "pop" : 50257}
{ "_id" : "G", "name" : "Gabon", "pop" : 369536 }
{ "_id" : "M", "name" : "Montgomery", "pop" : 102585 }
{ "_id" : "LA", "name" : "Los Angeles", "pop" : 38562 }
</code></pre>

<p>I've used this code to get me the following table:</p>

<pre><code>db.project.find({pop:{$gt: 0}}, {name:1})

{ "_id" : "LA", "name" : "Los Angeles" }
{ "_id" : "WF", "name" : "Westfalia" }
{ "_id" : "M", "name" : "Montgomery" }
{ "_id" : "G", "name" : "Gabon" }
{ "_id" : "D", "name" : "Dar-e-salaam" }
