Error: Config validation error: child "JWT_SECRET" fails because ["JWT_SECRET" is required]<p>I am currently work on project built on <code>NODE</code>. I design an api for the project. When I run the server, the api is working okay. So in the next step, I write a test case for my api. It gives me an unexpected result. My code is fall down in my <code>config.js</code> file. After some debugging I find out that, it can not take input from <code>process.ENV</code>. However, I don't understand why does it can not. I define a <code>.env</code> file in my root folder. I am sharing my <code>folder structure</code>, <code>config.js</code>, <code>test.js</code> and <code>.env</code> file here. Please check it and let me know which things did I miss here.   </p>

<p><strong>Folder Structure</strong> </p>

<pre><code>project
   README.md
   config
|   |___config.js

server

   ___helpers

   registration
       ______ user
|                 |_____ user.route.js 
                 |_____ user.model.js
|                 |_____ user.controller.js
                 |_____ user.test.js

|.env
|___ package.json
|___ index.js
|___ index.route.js

</code></pre>

<p><strong>Config.js</strong></p>

<pre><code>const Joi = require('joi');

// require and configure dotenv, will load vars in .env in PROCESS.ENV
require('dotenv').config();

console.log(process.env.PORT);
// define validation for all the env vars
const envVarsSchema = Joi.object({
  NODE_ENV: Joi.string()
    .allow(['development', 'production', 'test', 'provision'])
    .default('development'),
  PORT: Joi.number()
    .default(4040),
  MONGOOSE_DEBUG: Joi.boolean()
    .when('NODE_ENV', {
      is: Joi.string().equal('development'),
      then: Joi.boolean().default(true),
      otherwise: Joi.boolean().default(false)
    }),
  JWT_SECRET: Joi.string().required()
    .description('JWT Secret required to sign'),
  MONGO_HOST: Joi.string().required()
    .description('Mongo DB host url'),
  MONGO_PORT: Joi.number()
    .default(27017)
}).unknown()
  .required();

const { error, value: envVars } = Joi.validate(process.env, envVarsSchema);
if (error) {
  throw new Error(`Config validation error: ${error.message}`);
}

const config = {
  env: envVars.NODE_ENV,
  port: envVars.PORT,
  mongooseDebug: envVars.MONGOOSE_DEBUG,
  jwtSecret: envVars.JWT_SECRET,
  mongo: {
    host: envVars.MONGO_HOST,
    port: envVars.MONGO_PORT
  }
};

module.exports = config;
</code></pre>

