  mongoose.models = {};
  mongoose.modelSchemas = {};
  mongoose.connection.close();
  done();
});

describe('## User APIs', () =&gt; {
  let user = {
    name: 'KK123',
    gender: 'male',
    skillArea: 'nodeJs',
    email: 'a@a.com',
    mobileNumber: '1234567890',
    password: '123456'
  };

  describe('# POST /api/v1/register/user', () =&gt; {
    it('should create a new user', (done) =&gt; {
      request(app)
