Value added to array when using $project<p>I am writing an aggregation pipeline to return a win ratio. When I use $sum the value is output from <s>$facet</s> $project <em>within an array</em>. This has me confused. To solve the issue I simply run $sum on the arrays when I calculate the winRatio, which works fine. <strong>How do I use $project without it adding values into an array?</strong></p>

<pre><code>Round.aggregate([
  {
    $match: {
      $and: query,
    },
  },
  {
    $facet: {
      wins: [
        {
          $match: {
            winner: user,
          },
        },
        {
          $group: {
            _id: { user: '$scores.player', game: '$game' },
            value: { $sum: 1 }, // value *not* within array
          },
        },
      ],
      rounds: [
        {
          $unwind: '$scores',
        },
        {
          $match: {
            'scores.player': user,
          },
        },
        {
          $group: {
            _id: { user: '$scores.player', game: '$game' },
            value: { $sum: 1 }, // value *not* within array
          },
        },
      ],
    },
  },
  {
    $project: {
      _id: '$rounds._id',
      rounds: '$rounds.value', // value within an array
      wins: '$wins.value',  // value within an array
      winRatio: { ... },
    },
  },
]);
</code></pre>

<p>Schema:</p>

<pre><code>const schema = new mongoose.Schema(
  {
    game: { type: mongoose.Schema.ObjectId, required: true },
    scores: [
      {
        player: { type: mongoose.Schema.ObjectId, ref: 'User', required: true },
        playerName: { type: String }, // denormalise
        score: { type: Number, required: true },
      },
    ],
    winner: { type: mongoose.Schema.ObjectId, required: true },
    datePlayed: { type: Date },
  },
  { timestamps: true },
);
</code></pre>

