Combine 2 MongoDB collections into one api URL (not merging the collections, keeping them separate)<p>Im new to all this and need a little help please:</p>

<p>I have two Mongodb collections (Im using mongoose), <strong>Clients</strong> and <strong>Options</strong>.</p>

<p>They are not linked to each other.</p>

<p>I need to access both sets f data on one page in another app.</p>

<p>I can create an API Route pointing to each of these collections:</p>

<p>Clients: <a href="https://example.com/api/clients" rel="nofollow noreferrer">https://example.com/api/clients</a></p>

<p>Options: <a href="https://example.com/api/options" rel="nofollow noreferrer">https://example.com/api/options</a></p>

<p>But what is the best way to merge these two into <strong>one</strong> API Route eg:</p>

<p><a href="https://example.com/api/clients_options" rel="nofollow noreferrer">https://example.com/api/clients_options</a> (URL is irrelevant I just need both sets of data Clients &amp; Options to be accessible from both.)</p>

<p>Here is my Clients Model/Schema:</p>

<pre><code>const ClientSchema = new mongoose.Schema({
    client: String,
    brands: [
        {
         type: mongoose.Schema.Types.ObjectId,
         ref: 'Brand'
        }
    ]

});

module.exports = mongoose.model('Client', ClientSchema);
</code></pre>

<p>here is my Options Model/Schema:</p>

<pre><code>const OptionsSchema = new mongoose.Schema({
    agencies: Array,
    asset_types: Array,
    format: Array,
});

module.exports = mongoose.model('Options', OptionsSchema);
</code></pre>

<p>I was thinking the best way to do this is to create a <strong>master</strong> Model/Schema that wraps both the <strong>Clients</strong> and <strong>Options</strong> schemas the way the <strong>Client</strong> Model/Schema wraps the <em>Brand</em> Schema.</p>

<p>eg:</p>

<pre><code>const MasterSchema = new mongoose.Schema({
    clients: {
         type: mongoose.Schema.Types.ObjectId,
         ref: 'Clients'
       },
    options: {
         type: mongoose.Schema.Types.ObjectId,
         ref: 'Options'
       }

});

module.exports = mongoose.model('Master', MasterSchema);
</code></pre>

<p>But when I do this, my new Masters Model/Schema doesn't seem to populate with the existing Client and Option Model/Schemas, so my new <strong>Master</strong> Model/Schema stays blank and doesn't get created as a collection?</p>

<p>Is there a better way to do this?</p>

<p><strong>These are my Routes for each:</strong></p>

<pre><code>//CLIENT API
    app.get('/api/clients',function(req, res){
        Client.find({})
            .populate({
                path: 'brands',
                populate: {
                    path: 'campaigns',
                    model: 'Campaign'
                } 
            }).exec(function(err, clients){
                if(err) {
                    console.log('ERROR!');
                } else {
                    let data = [];
                    clients.forEach(client =&gt; {

                        //console.log(client);
                        data.push(client);
                    });
                    res.send({clients: data});
                }
            });
    });
</code></pre>

<pre><code>    //OPTIONS API
    app.get('/api/options',function(req, res){
        Options.find({})
            .exec(function(err, options){
                if(err) {
                    console.log('ERROR!');
                } else {
                    let data = [];
                    options.forEach(option =&gt; {

                        //console.log(client);
                        data.push(option);
                    });
                    res.send({options: data});
                }
            });
